package se.lnu.http;

import java.io.File;

import se.lnu.http.exceptions.InvalidPortException;
import se.lnu.http.view.ConsoleView;


public class HTTPServerConsole {
	private ConsoleView view;
	private ServerFactory factory;

	public HTTPServerConsole(ConsoleView view, ServerFactory factory ) {
		this.view = view;
		this.factory = factory;
	}

	/**
	 * @param args
	 * @throws Exception 
	 */
	public static void main(String[] args) throws Exception {
		ConsoleView view = new ConsoleView(args);
		ServerFactory factory = new ServerFactory();
		HTTPServerConsole server = new HTTPServerConsole(view, factory);
		server.runConsole();


	}

	void runConsole() throws Exception {

		try {
			Port port = view.getPort();
			File sharedDirectory = view.getDirectory();
			HTTPServer server = factory.create(port, sharedDirectory, view);

			server.start();

			while(true) {
				if (view.doStop()) {
					server.stop();
					break;
				}
			}

		} catch (InvalidPortException e) {
			view.showhelp();
		}
	}

}

package se.lnu.http;

import java.io.File;
import java.io.IOException;
import java.net.ServerSocket;

import se.lnu.http.exceptions.NotStartedException;


public class HTTPServer {


	private HTTPServerObserver view;

	private Port port;
	private AcceptThread acceptThread;

	private SharedFolder sharedDirectory;

	public HTTPServer(Port port, SharedFolder sharedDirectory, HTTPServerObserver view) {
		this.view = view;
		view.serverConstructed();
		this.port = port;
		this.sharedDirectory = sharedDirectory;
	}

	public void start() throws IOException {
		ServerSocket socket = new ServerSocket(port.getPort());
		ClientFactory factory = new ClientFactory(this.sharedDirectory);
		acceptThread = new AcceptThread(socket, view, factory);

		acceptThread.start();

		view.serverStarted();
	}

	public void stop() throws NotStartedException, InterruptedException, IOException {
		if (acceptThread == null)
			throw new NotStartedException();

		acceptThread.stopme();

		while(acceptThread.isAlive()) {
			Thread.sleep(100);
		}


		view.serverStopped();

		acceptThread = null;
	}

}

package se.lnu.http;

import se.lnu.http.exceptions.MalformedRequestException;

public class HTTPRequestParser {

	public static HTTPRequest parseRequest(String requestString) throws MalformedRequestException {

		String[] parts = requestString.split("\r\n");
		if (parts.length < 1) {
			throw new MalformedRequestException(requestString);
		}

		String[] requestType = parts[0].split(" ");
		if (requestType.length != 3) {
			throw new MalformedRequestException(requestString);
		}

		HTTPRequest.Method method = HTTPRequest.Method.fromString(requestType[0]);


		return new HTTPRequest(method, requestType[1]);
	}


}

package se.lnu.http;

import se.lnu.http.exceptions.*;

public class HTTPRequest {
	//http://en.wikipedia.org/wiki/Hypertext_Transfer_Protocol
	public enum Method {
	    GET, POST, HEAD, PUT, DELETE, TRACE, OPTIONS, CONNECT, PATCH;

	    static Method fromString(String stringMethod) throws MalformedRequestException {
	    	for(Method m : Method.values()) {
	    		if (stringMethod.equals(m.name())) {
	    			return m;
	    		}
	    	}
	    	throw new MalformedRequestException("unknown method ["+stringMethod+"]");

	    }
	}

	private String url;
	private Method requestType;

	public HTTPRequest(Method requestType, String url) {
		this.url = url;
		this.requestType = requestType;
	}

	public String getURL() {

		return this.url;
	}

	public Method getMethod() {
		return requestType;
	}

}

package se.lnu.http;

import java.io.BufferedReader;
import java.io.IOException;

public class HTTPReader {
	private int contentlength = 0;

	BufferedReader reader;

	public HTTPReader(BufferedReader reader) {
		this.reader = reader;
	}

	public String readBody() throws IOException {
		StringBuilder data = new StringBuilder();
		for (int i = 0; i < contentlength; i++) {
			data.append((char)reader.read());
		}

		return data.toString();
	}

	public String readHeader()
			throws IOException {
		StringBuilder data = new StringBuilder();
		/*String statusLine = reader.readLine();

		if (statusLine == null) { //eof http://docs.oracle.com/javase/1.4.2/docs/api/java/io/BufferedReader.html
			throw new IOException("eof");
		}
		data.append(statusLine);
		data.append("\r\n");*/

		//read header lines

		while (true) {
			String lineRead = reader.readLine();

			if (lineRead == null) { //eof http://docs.oracle.com/javase/1.4.2/docs/api/java/io/BufferedReader.html
				throw new IOException("eof");
			}

			data.append(lineRead);
			data.append("\r\n");
			if (lineRead == null || lineRead.equals("\r\n") || lineRead.equals("")) {
				break;
			}
			if (lineRead.startsWith("Content-Length:")) {
				String number = lineRead.substring(16);
				contentlength  = Integer.parseInt(number); 
			}

		}

		return data.toString() + readBody();
	}
}

package se.lnu.http;

import java.io.IOException;
import se.lnu.http.exceptions.MalformedRequestException;
import se.lnu.http.response.HTTPResponse;


public class ClientThread extends Thread{


	private ClientSocket clientSocket;
	private ResponseFactory factory;

	public ClientThread(ClientSocket clientSocket,
						ResponseFactory factory) {
		this.clientSocket = clientSocket;

		this.factory = factory;
	}

	public void run() {

		try {


			String requestString = clientSocket.getRequest();

			HTTPRequest request = HTTPRequestParser.parseRequest(requestString);
			HTTPResponse response = factory.getResponse(request);

			response.writeResponse(clientSocket);

		} catch (IOException e) {
			e.printStackTrace();
		} catch (MalformedRequestException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}

		try {
			clientSocket.close();
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
		System.out.println("client ended");
	}





}

package se.lnu.http;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.net.Socket;

public class ClientSocket {

	private Socket sock;

	public ClientSocket(Socket sock) {
		this.sock = sock;
	}

	public String getRequest() throws IOException {
		BufferedReader in = new BufferedReader(new InputStreamReader(sock.getInputStream()));
		HTTPReader httpReader = new HTTPReader(in);
		String requestString = httpReader.readHeader();
		return requestString;
	}

	public void writeHeader(String response) throws IOException {

		PrintWriter out = new PrintWriter(sock.getOutputStream(), true);
		out.write(response.toString());
		out.flush();



	}

	public void close() throws IOException {
		sock.close();

	}

	public void writeBody(byte[] bytes) throws IOException {
		sock.getOutputStream().write(bytes);
	}

}

